import com.eviware.soapui.support.XmlHolder
import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext

//def emailGroovyTS = testRunner.testCase.getPropertyValue("email")
//log.info emailGroovyTS

def emailGroovyTS = context.expand('${#TestCase#email}')
log.info emailGroovyTS
def firstnameGroovyTS = context.expand('${#TestCase#firstname}')
log.info firstnameGroovyTS
def lastnameGroovyTS = context.expand('${#TestCase#lastname}')
log.info lastnameGroovyTS
def dobGroovyTS = context.expand('${#TestCase#dob}')
log.info dobGroovyTS
def regioncodeGroovyTS = context.expand('${#TestCase#regioncode}')
log.info regioncodeGroovyTS
def regionGroovyTS = context.expand('${#TestCase#region}')
log.info regionGroovyTS
def countryIdGroovyTS = context.expand('${#TestCase#countryId}')
log.info countryIdGroovyTS
def itemGroovyTS = context.expand('${#TestCase#item}')
log.info itemGroovyTS
def telephoneGroovyTS = context.expand('${#TestCase#telephone}')
log.info telephoneGroovyTS
def postcodeGroovyTS = context.expand('${#TestCase#postcode}')
log.info postcodeGroovyTS
def cityGroovyTS = context.expand('${#TestCase#city}')
log.info cityGroovyTS
def shippingGroovyTS = context.expand('${#TestCase#defaultShipping}')
log.info shippingGroovyTS
def billingGroovyTS = context.expand('${#TestCase#defaultBilling}')
log.info billingGroovyTS

//set values in request 
def custsaveRequest = testRunner.testCase.testSuite.testCases["CustomerSaveTC"].testSteps["SaveTS"].getPropertyValue("Request")
log.info custsaveRequest
def parseRequest = new XmlHolder(custsaveRequest)
parseRequest.setNodeValue("//customer/email",emailGroovyTS)
parseRequest.setNodeValue("//customer/firstname",firstnameGroovyTS)
parseRequest.setNodeValue("//customer/lastname",lastnameGroovyTS)
parseRequest.setNodeValue("//customer/dob",dobGroovyTS)
parseRequest.setNodeValue("//customer/addresses/item/region/regionCode",regioncodeGroovyTS)
parseRequest.setNodeValue("//customer/addresses/item/region/region",regionGroovyTS)
parseRequest.setNodeValue("//customer/addresses/item/countryId",countryIdGroovyTS)
parseRequest.setNodeValue("//customer/addresses/item/street/item",itemGroovyTS)
parseRequest.setNodeValue("//customer/addresses/item/telephone",telephoneGroovyTS)
parseRequest.setNodeValue("//customer/addresses/item/postcode",postcodeGroovyTS)
parseRequest.setNodeValue("//customer/addresses/item/city",cityGroovyTS)
parseRequest.setNodeValue("//customer/addresses/item/firstname",firstnameGroovyTS)
parseRequest.setNodeValue("//customer/addresses/item/lastname",lastnameGroovyTS)
parseRequest.setNodeValue("//customer/addresses/item/defaultShipping",shippingGroovyTS)
parseRequest.setNodeValue("//customer/addresses/item/defaultBilling",billingGroovyTS)

//save the new xml
def newXMLsavecustreq = parseRequest.getXml()
log.info newXMLsavecustreq
//adding new xml
testRunner.testCase.testSuite.testCases["CustomerSaveTC"].testSteps["SaveTS"].setPropertyValue("Request",newXMLsavecustreq)
//to run save custtc
def pointrunbtn = testRunner.testCase.testSuite.testCases["CustomerSaveTC"].testSteps["SaveTS"]
def contextsavecust = new WsdlTestRunContext(pointrunbtn)
pointrunbtn.run(testRunner, contextsavecust)

//get the actual value of response
def responsesavecust = testRunner.testCase.testSuite.testCases["CustomerSaveTC"].testSteps["SaveTS"].getPropertyValue("Response")
log.info responsesavecust
def parsesavecustResponse = new XmlHolder(responsesavecust)
def custid = parsesavecustResponse.getNodeValue("//result/id/text()")
log.info custid

//Need to pass the cust id in del tc

def custdelRequest = testRunner.testCase.testSuite.testCases["CustomerDelTC"].testSteps["DelTS"].getPropertyValue("Request")
log.info custdelRequest
def parsedelRequest = new XmlHolder(custdelRequest)
parsedelRequest.setNodeValue("//customerId",custid)

//save the new delete xml
def newXMLdelcustreq = parsedelRequest.getXml()
log.info newXMLdelcustreq
//adding new del cust xml
testRunner.testCase.testSuite.testCases["CustomerDelTC"].testSteps["DelTS"].setPropertyValue("Request",newXMLdelcustreq)
//to run the del soap request
def pointDelcustrunbtn = testRunner.testCase.testSuite.testCases["CustomerDelTC"].testSteps["DelTS"]
def contextdelcust = new WsdlTestRunContext(pointDelcustrunbtn)
pointDelcustrunbtn.run(testRunner, contextdelcust)

